import React from "react";
import ReactDom from "react-dom";
import './index.css';

// ==vars=

const img ="https://images-eu.ssl-images-amazon.com/images/I/61Vj89VXrxL._AC_SX184_.jpg";
const title ="101 Tales from Indian Mythology: Illustrated Stories for Children";
const author = "Om Books Editorial Team";

function Booklist(){
  return (
    <div>
    <Book />
    </div>
  );
}

const Book = () => {
  return (
    <section className="booklist">
      <img src={img} />
      <h3>{title}</h3>
      <p>{author}</p>
    </section>
  );
}






ReactDom.render(<Booklist />, document.getElementById("root"));
